INSERT INTO `sys_global_script` VALUES (1, 'js示例', 'JavaScript需要服务器安装Nodejs服务', 'N', 'N', '//演示函数\r\n\r\n/**\r\n * 扩展Date的Format函数\r\n * 月(M)、日(d)、小时(h)、分(m)、秒(s)、季度(q) 可以用 1-2 个占位符， \r\n * 年(y)可以用 1-4 个占位符，毫秒(S)只能用 1 个占位符(是 1-3 位的数字) \r\n * @param {[type]} fmt [description]\r\n */\r\nDate.prototype.Format = function(fmt) {\r\n    var o = {\r\n        \"M+\": this.getMonth() + 1, //月份 \r\n        \"d+\": this.getDate(), //日 \r\n        \"h+\": this.getHours(), //小时 \r\n        \"m+\": this.getMinutes(), //分 \r\n        \"s+\": this.getSeconds(), //秒 \r\n        \"S\": this.getMilliseconds() //毫秒 \r\n    };\r\n    if (/(y+)/.test(fmt)) fmt = fmt.replace(RegExp.$1, (this.getFullYear() + \"\").substr(4 - RegExp.$1.length));\r\n    for (var k in o)\r\n        if (new RegExp(\"(\" + k + \")\").test(fmt)) fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : ((\"00\" + o[k]).substr((\"\" + o[k]).length)));\r\n    return fmt;\r\n}\r\n\r\n//字符串连接,例如 $a=\"123\",$b=\"456\",则返回\"123456\"\r\nfunction g_concat(str1,str2){\r\n  return str1 + str2 ;\r\n}\r\n\r\n//数字相加,例如 $a=\"123\",$b=\"456\",则返回 579\r\nfunction g_addition(a, b) {\r\n	return parseInt(a) + parseInt(b);\r\n}\r\n\r\nconsole.log(g_concat(process.argv[2], process.argv[3]));\r\nconsole.log(g_addition(process.argv[2], process.argv[3]));\r\n//获取服务器时间\r\nconsole.log((new Date()).Format(\"yyyy年MM月dd日 hh:mm:ss\"));', '1', 'QRhgAxzkiPJnPDVvygFAvCNFqYHCyNOV', '', '2022-05-19 20:37:04', 'sadmin', '2022-05-21 14:39:52', 'JavaScript需要服务器安装Nodejs服务');
INSERT INTO `sys_global_script` VALUES (2, 'php示例', 'PHP需要服务器安装PHP服务', 'N', 'N', '<?php\r\n//演示函数\r\n\r\n//获取服务器时间\r\nfunction g_getTime(){\r\n  return date(\"Y-m-d H:i:s\");\r\n}\r\n\r\n//字符串连接,例如 $a=\"123\",$b=\"456\",则返回\"123456\"\r\nfunction g_concat($str1,$str2){\r\n  return $str1 . $str2 ;\r\n}\r\n\r\n//数字相加,例如 $a=\"123\",$b=\"456\",则返回 579\r\nfunction g_addition($a,$b){\r\n  return $a + $b;\r\n}\r\n\r\necho g_concat($argv[1], $argv[2]);\r\necho g_addition($argv[1], $argv[2]);\r\necho g_getTime();', '4', 'EuJZDgndDCSPefpVFAiXIWGnfgDJYpPG', '', '2022-05-19 22:49:52', 'sadmin', '2022-05-21 14:39:57', 'PHP需要服务器安装PHP服务');
INSERT INTO `sys_global_script` VALUES (3, 'python示例', 'Python需要服务器安装Python服务', 'N', 'N', '#!/usr/bin/env python3\r\n# -*- coding: utf-8 -*-\r\n\r\n# 演示函数\r\n\r\nimport sys\r\nimport time\r\n\r\n\r\n# 获取服务器时间\r\ndef g_get_time():\r\n    return time.strftime(\'%Y-%m-%d %H:%M:%S\', time.localtime())\r\n\r\n\r\n# 字符串连接,例如 $a=\"123\",$b=\"456\",则返回\"123456\"\r\ndef g_concat(str1, str2):\r\n    return str(str1) + str(str2)\r\n\r\n\r\n# 数字相加,例如 $a=\"123\",$b=\"456\",则返回 579\r\ndef g_addition(a, b):\r\n    return int(a) + int(b)\r\n\r\n\r\ndef main():\r\n    print(g_concat(sys.argv[1], sys.argv[2]))\r\n    print(g_addition(sys.argv[1], sys.argv[2]))\r\n    print(g_get_time())\r\n\r\n\r\nif __name__ == \'__main__\':\r\n    main()\r\n', '2', 'nKQIxAGxAgSiPYQRGxGDPRSlvcHKoRgH', '', '2022-05-19 22:53:32', 'sadmin', '2022-05-21 14:40:01', 'Python需要服务器安装Python服务');
