INSERT INTO `sys_oper_log` VALUES (2032, '通知公告', 2, 'com.ruoyi.web.controller.system.SysNoticeController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/notice', '127.0.0.1', '内网IP', '{\"noticeContent\":\"<p class=\\\"ql-align-center\\\"><strong><img src=\\\"http://hy.coordsoft.com/prod-api/profile/upload/2022/05/02/logoko_%E5%89%AF%E6%9C%AC_20220502003636A006.png\\\"></strong></p><p class=\\\"ql-align-center\\\"><strong>本站是【红叶网络验证与软件管理系统 v1.0.0】的演示站，非测试请勿下单。红叶网络验证是软件授权管理计费销售一站式解决方案</strong></p><p class=\\\"ql-align-center\\\"><strong>合作请联系QQ群：947144396 或 微信：coordsoft</strong></p><p class=\\\"ql-align-center\\\"><br></p>\",\"createBy\":\"admin\",\"createTime\":1647792709000,\"updateBy\":\"sadmin\",\"noticeType\":\"0\",\"updateTime\":1648186493000,\"params\":{},\"noticeId\":3,\"noticeTitle\":\"商城公告\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-02 00:46:46');
INSERT INTO `sys_oper_log` VALUES (2033, '通知公告', 2, 'com.ruoyi.web.controller.system.SysNoticeController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/notice', '127.0.0.1', '内网IP', '{\"noticeContent\":\"<ul><li>你说我的眼睛灿若星辰，那是因为你是星辰，而我的眼中只有你。</li><li>温暖的夏日，一杯香浓的咖啡，一份美味的冰淇淋，青春就是这么甜美。</li><li>站在青春的夕阳下，感受着过往，留下浅浅的笑靥，这大概就是我们的狂欢过得青春。</li><li>大海之于小溪，阳光之于地球，蓝天之于白云，棉花糖之于小朋友，美梦之于你，你之于我。</li><li>我喜欢那些闪光的东西，比如冬日的雪花，天上的星星，还有你的眼睛。</li><li>春阳灿灿，夏山如碧，秋蜩抱朴，冬日烈烈，皆愿与君长相随。</li><li>看天空的云，堆在了一起。看躺在地上的你，微笑的脸庞。</li><li>快乐很简单，就是春天的鲜花，夏天的绿荫，秋天的野果，冬天的漫天飞雪。</li><li>无数的花瓣轻轻摇曳，积攒着彩虹般的梦，承载着我的思念。</li><li>往事不必再提，人生已多风雨，我只愿风止于秋水，而我止于你。</li></ul>\",\"createBy\":\"admin\",\"createTime\":1635392028000,\"updateBy\":\"sadmin\",\"noticeType\":\"0\",\"remark\":\"管理员\",\"updateTime\":1647792267000,\"params\":{},\"noticeId\":1,\"noticeTitle\":\"商城公告\",\"status\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-02 00:46:50');
