INSERT INTO `sys_oper_log` VALUES (2148, 'WEB API', 10, 'com.ruoyi.api.v1.controller.ApiV1Controller.api()', 'POST', 1, NULL, NULL, '/api/v1/VdIlnAXmkxngZcyePGeOOdoEeCbiNAsr', '114.254.226.6', '北京市 北京市', 'VdIlnAXmkxngZcyePGeOOdoEeCbiNAsr {\"api\":\"appInfo.ng\",\"app_secret\":\"FwPymKDepDHKxABfgIgCUdQBmYJOwBxq\",\"sign\":\"6cb7d59ad2fdc64da22af3b82c4312eb\"}', '{\"appName\":\"软件-账号计时\",\"authType\":\"ACCOUNT\",\"billType\":\"TIME\",\"bindType\":\"ONE_TO_ONE\",\"dataExpireTime\":-1,\"description\":\"百度网盘（原百度云）是百度推出的一项云存储服务，已覆盖主流PC和手机操作系统，包含Web版、Windows版、Mac版、Android版、iPhone版和Windows Phone版。\",\"freeQuotaReg\":0,\"heartBeatTime\":300,\"isCharge\":\"Y\",\"limitOper\":\"TIPS\",\"loginLimitM\":-1,\"loginLimitU\":-1,\"offNotice\":\"软件正在维护中\",\"reduceQuotaUnbind\":1,\"status\":\"0\",\"welcomeNotice\":\"欢迎您使用本软件\"}', 0, NULL, '2022-05-14 00:54:34');
INSERT INTO `sys_oper_log` VALUES (2149, 'WEB API', 10, 'com.ruoyi.api.v1.controller.ApiV1Controller.api()', 'POST', 1, NULL, NULL, '/api/v1/VdIlnAXmkxngZcyePGeOOdoEeCbiNAsr', '114.254.226.6', '北京市 北京市', 'VdIlnAXmkxngZcyePGeOOdoEeCbiNAsr {\"api\":\"versionInfo.ng\",\"app_secret\":\"FwPymKDepDHKxABfgIgCUdQBmYJOwBxq\",\"appVer\":\"1\",\"sign\":\"023089a48eb3b3c67e0aa054d4491df9\"}', '{\"downloadUrl\":\"http://www.baidu.com\",\"forceUpdate\":\"N\",\"md5\":\"\",\"remark\":\"0120\",\"status\":\"0\",\"updateLog\":\"1、新增任务模式选项，可将客户端切换为队员模式，此时该客户端相当于只选择了\\\"队员模式\\\"，将不再执行已选任务列表中的任务，可达到一个脚本同时控制两个客户端并进行组队的效果\\n2、新增探索副本结算加速功能，开启后会提升探索副本结算速度，但会造成\\\"数据统计\\\"页面战斗胜利/失败次数无法准确统计\\n3、新增探索副本在结束时如果发现探索宝箱将会自动拾取（非boss宝箱）\\n4、修复队员模式有时会卡在探索难度选择界面的问题\\n5、修复探索副本的邀请好友功能在使用脚本截图时造成脚本崩溃的问题\\n6、修复探索副本组队邀请好友有时会卡在选择难度界面的问题\\n7、优化探索副本修改为默认不攻打石矩、年兽、妖气、碎片\\n8、优化在选择自动保存日志情况下停止脚本会无响应的问题\\n9、优化探索副本如果中途退出不会退回探索，直接从难度选择界面开始战斗\\n10、优化御魂和觉醒的组队邀请好友的一些问题\\n11、其他细节优化\",\"versionName\":\"v1.4.5\",\"versionNo\":1}', 0, NULL, '2022-05-14 00:54:35');
