INSERT INTO `sys_oper_log` VALUES (2190, '全局脚本', 2, 'com.ruoyi.web.controller.system.SysGlobalScriptController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/globalScript', '127.0.0.1', '内网IP', '{\"description\":\"测试测试测试测试测试测试测试\",\"language\":\"javascript\",\"updateTime\":1652964035112,\"checkToken\":\"N\",\"params\":{},\"content\":\"function test(a, b) {\\r\\n\\treturn a + b;\\r\\n}\\r\\n\\r\\nconsole.log(process.argv);\\r\\nconsole.log(test(parseInt(process.argv[2]), parseInt(process.argv[3]), parseInt(process.argv[4])));\\r\\n\\r\\n\\r\\n/**\\r\\n * 扩展Date的Format函数\\r\\n * 月(M)、日(d)、小时(h)、分(m)、秒(s)、季度(q) 可以用 1-2 个占位符， \\r\\n * 年(y)可以用 1-4 个占位符，毫秒(S)只能用 1 个占位符(是 1-3 位的数字) \\r\\n * @param {[type]} fmt [description]\\r\\n */\\r\\nDate.prototype.Format = function(fmt) { //author: meizz \\r\\n    var o = {\\r\\n        \\\"M+\\\": this.getMonth() + 1, //月份 \\r\\n        \\\"d+\\\": this.getDate(), //日 \\r\\n        \\\"h+\\\": this.getHours(), //小时 \\r\\n        \\\"m+\\\": this.getMinutes(), //分 \\r\\n        \\\"s+\\\": this.getSeconds(), //秒 \\r\\n        \\\"S\\\": this.getMilliseconds() //毫秒 \\r\\n    };\\r\\n    if (/(y+)/.test(fmt)) fmt = fmt.replace(RegExp.$1, (this.getFullYear() + \\\"\\\").substr(4 - RegExp.$1.length));\\r\\n    for (var k in o)\\r\\n        if (new RegExp(\\\"(\\\" + k + \\\")\\\").test(fmt)) fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : ((\\\"00\\\" + o[k]).substr((\\\"\\\" + o[k]).length)));\\r\\n    return fmt;\\r\\n}\\r\\n\\r\\nconsole.log((new Date()).Format(\\\"yyyy-MM-dd hh:mm:ss\\\")); // 2018-08-02 21:22:07\",\"checkVip\":\"N\",\"createBy\":\"\",\"scriptId\":1,\"createTime\":1652963824000,\"updateBy\":\"\",\"name\":\"测试\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-19 20:40:35');
