INSERT INTO `sys_oper_log` VALUES (2199, '全局脚本', 2, 'com.ruoyi.web.controller.system.SysGlobalScriptController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/globalScript', '127.0.0.1', '内网IP', '{\"language\":\"python3\",\"updateTime\":1652972176168,\"checkToken\":\"N\",\"params\":{},\"content\":\"#!/usr/bin/env python3\\r\\n# -*- coding: utf-8 -*-\\r\\n\\r\\n\\r\\ndef Merge(dict1, dict2): \\r\\n    res = {**dict1, **dict2} \\r\\n    return res \\r\\n\\r\\n\\r\\ndef main():\\r\\n    # 两个字典\\r\\n    dict1 = {\\\"name\\\": \\\"Joy\\\", \\\"age\\\": 25}\\r\\n    dict2 = {\\\"name\\\": \\\"Joy\\\", \\\"city\\\": \\\"New York\\\"}\\r\\n    dict3 = Merge(dict1, dict2) \\r\\n    print(dict3)\\r\\n\\r\\n\\r\\nif __name__ == \'__main__\':\\r\\n    main()\",\"checkVip\":\"N\",\"createBy\":\"\",\"scriptId\":3,\"createTime\":1652972012000,\"updateBy\":\"\",\"name\":\"python示例\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-19 22:56:16');
