INSERT INTO `sys_oper_log` VALUES (2362, '全局脚本', 2, 'com.ruoyi.web.controller.system.SysGlobalScriptController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/globalScript', '127.0.0.1', '内网IP', '{\"description\":\"PHP需要服务器安装PHP服务\",\"language\":\"PHP\",\"updateTime\":1653115085638,\"checkToken\":\"N\",\"params\":{},\"content\":\"<?php\\r\\n//演示函数\\r\\n\\r\\n//获取服务器时间\\r\\nfunction g_getTime(){\\r\\n  return date(\\\"Y-m-d H:i:s\\\");\\r\\n}\\r\\n\\r\\n//字符串连接,例如 $a=\\\"123\\\",$b=\\\"456\\\",则返回\\\"123456\\\"\\r\\nfunction g_concat($str1,$str2){\\r\\n  return $str1 . $str2 ;\\r\\n}\\r\\n\\r\\n//数字相加,例如 $a=\\\"123\\\",$b=\\\"456\\\",则返回 579\\r\\nfunction g_addition($a,$b){\\r\\n  return $a + $b;\\r\\n}\\r\\n\\r\\necho g_concat($argv[1], $argv[2]);\\r\\necho g_addition($argv[1], $argv[2]);\\r\\necho g_getTime();\",\"checkVip\":\"N\",\"scriptKey\":\"EuJZDgndDCSPefpVFAiXIWGnfgDJYpPG\",\"createBy\":\"\",\"scriptId\":2,\"createTime\":1652971792000,\"updateBy\":\"sadmin\",\"name\":\"php示例\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-21 14:38:05');
INSERT INTO `sys_oper_log` VALUES (2363, '全局脚本', 2, 'com.ruoyi.web.controller.system.SysGlobalScriptController.edit()', 'PUT', 1, 'sadmin', NULL, '/system/globalScript', '127.0.0.1', '内网IP', '{\"description\":\"Python需要服务器安装Python服务\",\"language\":\"PYTHON3\",\"updateTime\":1653115149502,\"checkToken\":\"N\",\"params\":{},\"content\":\"#!/usr/bin/env python3\\r\\n# -*- coding: utf-8 -*-\\r\\n\\r\\n# 演示函数\\r\\n\\r\\nimport sys\\r\\nimport time\\r\\n\\r\\n\\r\\n# 获取服务器时间\\r\\ndef g_get_time():\\r\\n    return time.strftime(\'%Y-%m-%d %H:%M:%S\', time.localtime())\\r\\n\\r\\n\\r\\n# 字符串连接,例如 $a=\\\"123\\\",$b=\\\"456\\\",则返回\\\"123456\\\"\\r\\ndef g_concat(str1, str2):\\r\\n    return str(str1) + str(str2)\\r\\n\\r\\n\\r\\n# 数字相加,例如 $a=\\\"123\\\",$b=\\\"456\\\",则返回 579\\r\\ndef g_addition(a, b):\\r\\n    return int(a) + int(b)\\r\\n\\r\\n\\r\\ndef main():\\r\\n    print(g_concat(sys.argv[1], sys.argv[2]))\\r\\n    print(g_addition(sys.argv[1], sys.argv[2]))\\r\\n    print(g_get_time())\\r\\n\\r\\n\\r\\nif __name__ == \'__main__\':\\r\\n    main()\\r\\n\",\"checkVip\":\"N\",\"scriptKey\":\"nKQIxAGxAgSiPYQRGxGDPRSlvcHKoRgH\",\"createBy\":\"\",\"scriptId\":3,\"createTime\":1652972012000,\"updateBy\":\"sadmin\",\"name\":\"python示例\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-21 14:39:09');
